import React from "react";
import { Link } from "react-router-dom";
import { useAuth0 } from "@auth0/auth0-react";
import { LoginButton } from "./Login";
import { LogoutButton } from "./Logout";
import { Profile } from "./Profile";
import logo from "../img/icon.png"; // Asumiendo que el logo está en la carpeta img
import "./Header.css";

function Header() {
    const { isAuthenticated } = useAuth0();

    return (
        <header className="App-header">
            <div className="header-top">
                {/* Logo */}
                <img src={logo} className="App-logo" alt="logo" />

                {/* Buscador con ícono de búsqueda */}
                <div className="input-group">
                    <select className="dropdown">
                        <option value="all">All</option>
                        <option value="recipes">Recipes</option>
                        <option value="services">Services</option>
                        <option value="restaurants">Restaurants</option>
                    </select>
                    <input type="text" className="input" placeholder="Search..." />
                    <button className="button--submit">
                        <i class='bx bx-search'></i>
                    </button>
                </div>

                {/* Acciones del usuario (Perfil, Login, Logout, Carrito) */}
                <div className="user-actions">
                    {isAuthenticated ? (
                        <>
                            <Profile />
                            <LogoutButton />
                        </>
                    ) : (
                        <LoginButton />
                    )}
                    <button className="favorite-button">
                        <i className="bx bx-heart"></i>
                    </button>
                    <button className="cart-button">
                    <i class='bx bx-receipt'>Cart: 00</i>
                    </button>
                </div>
            </div>

            {/* Línea de separación añadida automáticamente por CSS */}

            {/* Navegación */}
            <nav className="navigation">
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/recipes">Recipes</Link>
                    </li>
                    <li>
                        <Link to="/service">Service</Link>
                    </li>
                    <li>
                        <Link to="/restaurants">Restaurants</Link>
                    </li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;
